import React from "react";

const Index = (props) => {
  return (
    <div className="card">
      <div className="zone">
        <h1>{props.timezones.Name._text}</h1>
        <h3>GMT+0{props.timezones.Hours._text}</h3>
      </div>
      <div className="time">
        <p>17:30:47</p>
      </div>
    </div>
  );
};

export default Index;
